function MainPage() {
  const [selectedDevice, setSelectedDevice] = useState(null);

  return (
    <div>
      <h1>Main Page</h1>
      <DeviceList onDeviceSelect={(device) => setSelectedDevice(device)} />
      <MaaS360Data device_id={selectedDevice?.id} />
    </div>
  );
}
